import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

const Notebook = ({ steps }) => {
  return (
    <Box sx={{ mt: 4 }}>
      {steps.map((step, index) => (
        <Paper key={index} sx={{ p: 2, mb: 3 }} elevation={3}>
          <Typography variant="subtitle1" color="textSecondary">
            Step {index + 1}: {step.prompt}
          </Typography>

          <Typography variant="subtitle2" sx={{ mt: 2 }}>
            Generated Code:
          </Typography>
          <Paper variant="outlined" sx={{ p: 1, bgcolor: '#f9f9f9', overflowX: 'auto' }}>
            <pre style={{ margin: 0 }}>{step.code}</pre>
          </Paper>

          {step.output && (
            <>
              <Typography variant="subtitle2" sx={{ mt: 2 }}>
                Output Preview:
              </Typography>
              {step.output.type === 'text' && (
                <Paper sx={{ p: 1, mt: 1, bgcolor: '#f4f4f4' }}>
                  <pre>{step.output.content}</pre>
                </Paper>
              )}
              {step.output.type === 'image' && (
                <Box component="img" src={step.output.content} alt="Step Output" sx={{ width: '100%', maxWidth: 600, mt: 1 }} />
              )}
            </>
          )}
        </Paper>
      ))}
    </Box>
  );
};

export default Notebook;
